import "./Home.css";
import schoolVector from "../assets/school.jpg";

const Home = () => {
    return (

        <>    
            <div className="home">
                <h1>ReviewMyCourse</h1>
                <div className="home-banner"> 
                    <div className="home-banner-text"> 
                        <h3>Review the course, not the professor.</h3>  
                    </div>
                    <img src={schoolVector} alt="Logo" style={{height: '20vw'}} />
                </div>
            </div>
        </>

    );
    }
export default Home;
